{"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"3.4.2","file_extension":".r","codemirror_mode":"r"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# Do any adult males survive? XGBoost will tell us!\nThere are 245 adult males in the Titanic test dataset. By reviewing all the top models on Kaggle, we see that everyone predicts that all adult males die. Is it possible to find at least 1 adult male that lived? If we can correctly predict the survival of any adult males, we can combine those predictions with a previously top scoring model, such as the WCG model, and have the most accurate Titanic model ever!   \n![tree12](https://raw.githubusercontent.com/cdeotte/Kaggle_Images/main/2020/tree12.jpeg)  \n  \nThe WCG (woman-child-group) model (displayed in yellow above) was first described [here][1] and improved upon [here][2]. It was first implemented using only Name and scored 82%. Adding Ticket, Fare, and Pclass increased it's score to 83%. Then the [Mega Model][3] showed that there are patterns in the non-WCG passengers. This kernel finds those patterns and scores 85%.\n![tree12](https://raw.githubusercontent.com/cdeotte/Kaggle_Images/main/2020/xgb.jpeg)\n## Explore adult males survival with XGBoost\nFirst we'll load in the Titanic dataset and impute missing Age and Fare. Next we'll engineer two new variables, x1 = Fare / (Ticket Frequency * 10), and x2 = Parch + SibSp + 1 + (Age / 70). Reducing the feature space to 2 dimensions allows us to visualize everything.  \n  \n[1]:https://www.kaggle.com/cdeotte/titanic-using-name-only-0-81818\n[2]:https://www.kaggle.com/cdeotte/titantic-mega-model-0-84210\n[3]:https://www.kaggle.com/cdeotte/titantic-mega-model-0-84210","metadata":{"_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","trusted":true}},{"cell_type":"code","source":"train <- read.csv('../input/titanic/train.csv',stringsAsFactors=F)\ntest <- read.csv('../input/titanic/test.csv',stringsAsFactors=F)\ntest$Survived <- NA; data <- rbind(train,test)\n# engineer person type\ndata$Title <- 'man'\ndata$Title[grep('Master',data$Name)] <- 'boy'\ndata$Title[data$Sex=='female'] <- 'woman'\n# impute missing Age and Fare\nlibrary(rpart)\nfit <- rpart(Age ~ Title + Pclass + SibSp + Parch,data=data)\ndata$Age[is.na(data$Age)] <- predict(fit,newdata=data[is.na(data$Age),])\nfit <- rpart(Fare ~ Title + Pclass + Embarked + Sex + Age,data=data)\ndata$Fare[is.na(data$Fare)] <- predict(fit,newdata=data[is.na(data$Fare),])\n# engineer features\ndata$TicketFreq <- ave(1:1309,data$Ticket,FUN=length)\ndata$FareAdj <- data$Fare / data$TicketFreq\ndata$FamilySize <- data$SibSp + data$Parch + 1\n# isolate training set males\ndata2 <- data[data$PassengerId<=891 & data$Title=='man',]\n# engineer 2 features from Fare, Ticket, SibSp, Parch, and Age\ndata3 <- data.frame(\n    y=data2$Survived,\n    x1=data2$Fare / (data2$TicketFreq * 10),\n    x2=(data2$SibSp + data2$Parch + 1) + (data2$Age / 70),\n    Pclass=data2$Pclass)\n# plot engineered features\nlibrary(ggplot2)\nlibrary(gridExtra)\ng1 = ggplot(data[data$FareAdj>0 & data$FareAdj<40,]) + \n    geom_density(aes(x=FareAdj,fill=factor(Pclass)),alpha=0.9,show.legend=F) +\n    labs(fill='Pclass') + geom_vline(xintercept=c(10,20),linetype='dotted') +\n    xlim(0,40) + labs(title='All Passengers',x='x1 = Fare / Ticket Frequency')\ng2 = ggplot(data[data$Fare>0 & data$Fare<40 ,]) +\n    geom_density(aes(x=Fare,fill=factor(Pclass)),alpha=0.9) +\n    xlim(0,40) + labs(title='All Passengers',fill='Pclass',y='')\ng3 = ggplot(data[!is.na(data$Survived) & data$Title=='man' & data$Pclass==1 & data$FamilySize<4,]) + \n    geom_density(aes(x=FamilySize+Age/70,fill=factor(Survived)),alpha=0.9,bw=0.04) +\n    labs(fill='Survived') +\n    annotate('text',x=1.4,y=2.4,label='Age 30\\nFS=1') +\n    annotate('text',x=2.4,y=2.4,label='Age 30\\nFS=2') +\n    geom_vline(xintercept=c(1.43,2.43),linetype='dotted') +\n    xlim(1,4) + labs(title='Adult Males Pclass=1',x='x2 = FamilySize + Age/70')\ngrid.arrange(g3,g1,g2,layout_matrix = rbind(c(1, 1), c(2, 3)))","metadata":{"_cell_guid":"79c7e3d0-c299-4dcb-8224-4455121ee9b0","_uuid":"d629ff2d2480ee46fbb7e2d37f6b5fab8052498a","_kg_hide-input":true,"execution":{"iopub.status.busy":"2023-09-09T14:43:20.548387Z","iopub.execute_input":"2023-09-09T14:43:20.551849Z","iopub.status.idle":"2023-09-09T14:43:24.156673Z"},"trusted":true},"execution_count":1,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3hT1RsH8PferDarmxY6WWVPGTIFFBFQAZEtgoCIExUQREBRVIaiICiK8nOj\nKIJIWcoQFJUpMjuYHZTukTZt1v39cduQpm162yZpxvfzPD5PenNz70k4sW/f855zGI7jCAAA\nAADcH9vQDQAAAAAA+0BgBwAAAOAhENgBAAAAeAgEdgAAAAAeAoEdAAAAgIdAYAcAAADgIRDY\nAQAAAHgIBHYAAAAAHsLNAjvOqGkplzAMw7LS4xq98Beubh7AMMyunJJa3e6/Fd0Zhrl3b7Lw\nl+RcmsgwDMMwgbFvVnuSSdtaIeVPO5BX6ugm1VkTmZipiGXZoPDmvQYOffObP2u1sLUzmw0A\nAOC13Cywyz67IElrICKO07+09VpDN8eWvMtvnCs2VPlUbuLS+OJaRKUNK6xps+blmkaHFaZf\n/fvQnkWP9I0d+qrOQ3ct2dSrsSr82YZuBQAAQK25WWB3cO7PRNT4vhgiOv3aJiffXa85zTCM\nX/TiGs9kGBFnKp23N6XKZ08s+ZGIxAxj5/Y5xmcnzieVu3w1raQ4e/PbMxiGSdrz+qM7bzR0\n6+yvNPePOScyGroVAAAAdeFOgZ3JkP3CHzeJaMPGH2UsU3B91R8FuoZuVNXUMfNEDHNs4Y9V\nPMcZXt6dLFX1uNtf5vR22QErCxi/YOOXI6KJaP/CvQ3dHHsy6TWn9345ocf9eQZTQ7cFAACg\nLtwpsMs49mJqqVEVMfvBiDtebeHPccYFm680dKOqJvPr82KkKjdxSYLWejS24PqKk4W6qAfe\ndpeMXZXuXdyFiIpv7W/ohtjNt/e0l/uou943ZVtSfkO3BQAAoI7cKbDbM3cfEXVZ+hQRjVvW\njYj+W7ah8mnG0tQNi54e0rdLsFwW1LjpqBkLz+ZaT1D468m2DMM8dCHb8iBnyGMYRhHycJV3\n39wmWKrqSkQFN5YxDBPU6n+2WzttYXvOqJ1zIM3q+Jk3vyaica91rfwSkz7ju/cX9LujQ3iI\nn0Tu37RVhxGPL/o9qdD2jYjo6u9fz5g4smvrKB9f/xbtuz352oakSuV9+UmHX54yvGOrGKXU\nt3FMq0Gjntr1X2aNV66OqaRSrpTT7/t06djhA5qFqtSNorr3H75u+0lbVxD2Zmtstr3eV+Me\ndz/y2LTp06dPmXRXHV4OAADgEjg3YShNCZSwDCs5UajjOE6n+VfCMgzD/JpbUuE0bdJDLf34\nt9aoaYdW4X5E5BPQe0qogojisrX8aUdntSGiUeezLF9r0