unvtu31hPezYAGP6U9oc6lK14J09fV9WHrHfPagp2Ioh5\nYVQ9Xq4KQRozWdpSe7/Vwx/m7w+VmvnQlK4gO4vl5ClkVJ/Id2NxZOsv7h3OUw2sVS0eBKmH\nChJHODQ50GHnowtVJ7a/lkDWoW10dHTyuK7z8lqoCv8BgANNHCdkNad/BgDFiw1Cj7lV5DBF\ndWnnZLm+IEg56FYsgjQ+GEvq6mXKjqQub9amhyKvD1BUhzQqFk0gQxCLQjluCIJUbvqsD957\nq8V1uXbI9vl13RYEsSqt4o6WpFw6dzdEdSXPj698VgxQ+QrYTF7w0hBJys/Dz7x4NQnv2OLe\nXbp0uawlrNFiBHkJjdghSP2FYZg5qjjX0rVjex8UskZ8/Mu2Hh511ggEqQsWTSBDEItCgR2C\n1FMi389I8rM6bMDt1Nw6PDuC1CGMYff7jSMfTF96bNeXP3PcoqPbfHUxubf7/dlTVlw7G6eh\nPq74FKHviITUwA9nffLvX7v3Zmv8g8KWbf5r6ZS+1m880sih5AkEQRAEQRAbgebYIQiCIAiC\n2AgU2CEIgiAIgtgIFNghCIIgCILYCBTYIQiCIAiC2AgU2CEIgiAIgtgIFNghCIIgCILYCBTY\nIQiCIAiC2AgU2CEIgiAIgtiI/wPJF/ItMknujAAAAABJRU5ErkJggg=="},"metadata":{}}]},{"cell_type":"markdown","source":"By creating 'x2' = FamilySize + Age/70, we can view SibSp, Parch, and Age on 1 dimension. The plot above shows that adult males with FamilySize<=2 in Pclass=1 between the ages 20 and 36 have greater than 50% chance of survival. (To be exact, 56% = 18 / 32 survived in the training set). Also males in their 40's with FamilySize=2 have 63% (= 5 / 8 ) chance of survival. To create 'x1', we divide Fare by TicketFrequency because that is the actual price paid. The 11 Sage family members did not pay \\$69.55 for each of their 11 third class tickets. They must have paid \\$6.32 = 69.55 / 11. Notice above how the 3 Pclasses become separated once you adjust the Fare. Lastly, we divide 'x1' by 10 so that its scale matches the scale of 'x2' which helps certain machine learning algorithms. Let's apply XGBoost to the pair of variables (x1, x2) and see what patterns it discovers.","metadata":{"_uuid":"dc15771e73f98220774a5d29adc5604f251a5777"}},{"cell_type":"code","source":"# classify males with xgboost\nlibrary(xgboost)\nx1s <- seq(0, 5, length.out = 100)\nx2s <- seq(1, 3, length.out = 100)\ng <- data.frame(x1 = rep(x1s, each=100), x2 = rep(x2s, time = 100))\nparam <- list(objective   = \"binary:logistic\",\n            eval_metric = \"error\",\n            max_depth   = 5,\n            eta         = 0.1,\n            gammma      = 0.1,\n            colsample_bytree = 1,\n            min_child_weight = 1)\ncat('XGBoosting begun...\\n')\nxgb <- xgboost(params  = param,\n            data    = data.matrix(data3[,c('x1','x2')]),\n            label   = data3$y, \n            nrounds = 500,\n            print_every_n = 100,\n            verbose = 1)\np <- predict(xgb,newdata=data.matrix(g[,c('x1','x2')]))\ng$y <- ifelse(p>0.5,1,0)\n# plot classification regions\nggplot(data=data3[data3$x1<5 & data3$x2<3,]) +\n    xlim(0,5) + ylim(1,3) +\n    geom_tile(data=g,aes(x1,x2,fill=factor(y))) +\n    geom_density_2d(aes(x1,x2,color=factor(y))) +\n    geom_point(size=2,aes(x1,x2,color=factor(y),shape=factor(Pclass))) +\n    scale_color_manual(values=c('#AA0000','#00AA00'),\n        limits=c('0','1'),labels=c('0','1')) +\n    scale_fill_manual(values=c('#FF9999','#99FF99'),\n        limits=c('0','1'),labels=c('0','1')) +\n    labs(x='Fare / (10 x TicketFrequency)',y='FamilySize + (Age / 70)',shape='Pclass',fill='Classify',\n        title='XGBoost learns the training set\\'s\n        537 adult males. Green is P(live)>0.5',color='Survived') +\n    geom_vline(xintercept=2.8, linetype='dotted') +\n    geom_hline(yintercept=c(1.43,2.43), linetype='dotted') +\n    annotate('text',x=2.95,y=2.9,label='Fare = $28') +\n    annotate('text',x=4.7,y=2.35,label='Age = 30') +\n    annotate('text',x=4.7,y=1.35,label='Age = 30')","metadata":{"_kg_hide-input":true,"_uuid":"0e98a9609bd97bcd7b0c856f4ddf1274a2192526","execution":{"iopub.status.busy":"2023-09-09T14:43:24.158780Z","iopub.execute_input":"2023-09-09T14:43:24.182161Z","iopub.status.idle":"2023-09-09T14:43:26.616155Z"},"trusted":true},"execution_count":2,"outputs":[{"text":"XGBoosting begun...\n[1]\ttrain-error:0.119181 \n[101]\ttrain-error:0.087523 \n[201]\ttrain-error:0.067039 \n[301]\ttrain-error:0.057728 \n[401]\ttrain-error:0.054004 \n[500]\ttrain-error:0.048417 \n","name":"std