epth=5, p>=0.90. (If you wish to perform a grid search, uncomment the for loops in the code below and add hyperparamters that you wish to search. In this notebook, I'm not doing the grid search because it takes a while. I did it offline). Now let's perform cross validation to see to see if XGBoost is more accurate than the gender model which has CV = 78.6%.","metadata":{"_uuid":"3345019f7c301ae5ed7cfa7540310ecc524c69a3"}},{"cell_type":"code","source":"#accuracy = matrix(nrow=4,ncol=4)\n#rownames(accuracy) <- c('d=3','d=4','d=5','d=6')\n#colnames(accuracy) <- c('0.50','0.75','0.90','0.92')\n#for (j in 1:4)\n#for (k in 1:4){\nset.seed(2)\ntrials=100; sum=0\nfor (i in 1:trials){\n    s = sample(1:891,800)\n    s2 = (1:891)[-s]\n    dataB <- data[data$PassengerId %in% s & data$Title=='man',]\n    dataC <- data[data$PassengerId %in% s2 & data$Title=='man',]\n    data$Predict <- 0\n    data$Predict[data$Sex=='female'] <- 1\n    dataTrain <- data.frame(y=dataB$Survived,x1=dataB$FareAdj/10,x2=dataB$FamilySize+dataB$Age/70)\n    dataTest <- data.frame(y=dataC$Survived,x1=dataC$FareAdj/10\n        ,x2=dataC$FamilySize+dataC$Age/70,PassengerId=dataC$PassengerId)\n    param <- list(objective   = \"binary:logistic\",\n              eval_metric = \"error\",\n              max_depth   = 5,\n              eta         = 0.1,\n              gammma      = 0.1,\n              colsample_bytree = 1,\n              min_child_weight = 1)\n    xgb <- xgboost(params  = param,\n              data    = data.matrix(dataTrain[,c('x1','x2')]),\n              label   = dataTrain$y, \n              nrounds = 500,\n              silent = 1,\n              print_every_n = 100,\n              verbose = 0)\n    p <- predict(xgb,newdata=data.matrix(dataTest[,c('x1','x2')]))\n    dataTest$p <- ifelse(p>=0.90,1,0)\n    data$Predict[dataTest$PassengerId] <- dataTest$p \n    sm = sum(abs(data$Predict[s2] - data$Survived[s2]))\n    cv = 1 - sm/length(s2)\n    #if (i %% 25==0) \n    #cat(sprintf('Trial %d has CV = %f\\n',i,cv))\n    sum = sum + cv\n}\ncat(sprintf('Average CV of %d trials = %f\\n',trials,sum/trials))\n#accuracy[j,k] <- sum/trials\n#}\n#accuracy","metadata":{"_kg_hide-input":true,"_uuid":"d8c6c46d68f88e47351ad0b64c2bdb8686625ba1","execution":{"iopub.status.busy":"2023-09-09T14:43:27.538343Z","iopub.execute_input":"2023-09-09T14:43:27.540070Z","iopub.status.idle":"2023-09-09T14:43:49.310296Z"},"trusted":true},"execution_count":4,"outputs":[{"text":"Average CV of 100 trials = 0.790110\n","name":"stdout","output_type":"stream"}]},{"cell_type":"markdown","source":"Our CV accuracy is 79.0%. (Results shown above may vary due to the random nature of k-fold CV but I confirmed 79.0% with 10,000 trials offline). The gender model has a CV accuracy of 78.6%, therefore we have achieved a slight improvement. Hopefully, this will allow us to find at least 1 surviving adult male in the test dataset!\n## Submission to Kaggle","metadata":{"_uuid":"699fa387f05fb88dc228bc048f4c40b0450202b3"}},{"cell_type":"code","source":"dataB <- data[data$PassengerId %in% 1:891 & data$Title=='man',]\ndataC <- data[data$PassengerId %in% 892:1309 & data$Title=='man',]\ndata$Predict <- 0\ndata$Predict[data$Sex=='female'] <- 1\ndataTrain <- data.frame(y=dataB$Survived,x1=dataB$FareAdj/10,x2=dataB$FamilySize+dataB$Age/70)\ndataTest <- data.frame(y=dataC$Survived,x1=dataC$FareAdj/10,Pclass=dataC$Pclass\n    ,x2=dataC$FamilySize+dataC$Age/70,PassengerId=dataC$PassengerId)\nparam <- list(objective   = \"binary:logistic\",\n              eval_metric = \"error\",\n              max_depth   = 5,\n              eta         = 0.1,\n              gammma      = 0.1,\n              colsample_bytree = 1,\n              min_child_weight = 1)\nxgb <- xgboost(params  = param,\n              data    = data.matrix(dataTrain[,c('x1','x2')]),\n              label   = dataTrain$y, \n              nrounds = 500,\n              silent = 1,\n              print_every_n = 100,\n              verbose = 0)\np <- predict(xgb,newdata=data.matrix(dataTest[,c('x1','x2')]))\ndataTest$p <- ifelse(p>=0.90,1,0)\ndata$Predict[dataTest$PassengerId] <- dataTest$p \nmaleLive = which(data$Title=='man' & data$Predict==1)\ncat(sprintf('The following %d adult males are predicted to live\\n',length(maleLive)))\ndata[maleLive,c('PassengerId','Pclass','Name','Age','SibSp','Parch','FareAdj')]","metadata":{"_kg_hide-input":true,"_uuid":"d5aa5fbf16ce8dfb18aa4a57af50a41d375ca373","execution":{"iopub.status.busy":"2023-09-09T14:43:49.313095Z","iopub.execute_input":"2023-09-09T14:43:49.315079Z","iopub.status.idle":"2023-09-09T14:43:49.624670Z"},"trusted":true},"execution_count":5,"outputs":[{"text":"The following 4 adult males are predicted to live\n","name":"stdout","output_type":"stream"},{"output_type":"display_data","data":{"text/plain":"     PassengerId Pclass Name                     Age SibSp Parch FareAdj\n926   926        1      Mock, Mr. Philipp Edmund 30  1     0     28.875 \n942   942        1      Smith, Mr. Lucien Philip 24  1     0     30.000 \n1094 1094        1      Astor, Col. John Jacob   47  1     0     45.505 \n1215 1215        1      Rowe, Mr. Alfred G       33  0     0     26.550 ","text/latex":"\\begin{tabular}{r|lllllll}\n  & PassengerId & Pclass & Name & Age & SibSp & Parch & FareAdj\\\\\n\\hline\n\t926 &  926                     & 1                        & Mock, Mr. Philipp Edmund & 30                       & 1                        & 0                        & 28.875                  \\\\\n\t942 &  942                     & 1                        & Smith, Mr. Lucien Philip & 24                       & 1                        & 0                        & 30.000                  \\\\\n\t1094 & 1094                     & 1                        & Astor, Col. John Jacob   & 47                       & 1                        & 0                        & 45.505                  \\\\\n\t1215 & 1215                     & 1                        & Rowe, Mr. Alfred G       & 33  