lass, sub('.$','X',data$Ticket), data$Fare, data$Embarked, sep='-')\ndata$GroupId[data$Title=='man'] <- 'noGroup'\n# Mrs Wilkes (Needs) is Mrs Hocking (Needs) sister\ndata$GroupId[893] <- data$GroupId[775]\ndata$GroupFreq <- ave(1:1309,data$GroupId,FUN=length)\ndata$GroupId[data$GroupFreq<=1] <- 'noGroup'\ncat(sprintf('We found %d woman-child-groups\\n',length(unique(data$GroupId))-1))\ndata$TicketId = paste( data$Pclass,sub('.$','X',data$Ticket),data$Fare,data$Embarked,sep='-')\n# add nannies and relatives to groups\nc = 0\nfor (i in which(data$Title!='man' & data$GroupId=='noGroup')){\n    data$GroupId[i] = data$GroupId[data$TicketId==data$TicketId[i]][1]\n    if (data$GroupId[i]!='noGroup') c = c + 1\n}\ncat(sprintf('We found %d nannies/relatives and added them to groups.\\n',c))\n# calculate group survival rates\ndata$GroupSurvival <- NA\ndata$Survived <- as.numeric(as.character(data$Survived))\ndata$GroupSurvival[1:891] <- ave(data$Survived[1:891],data$GroupId[1:891])\nfor (i in 892:1309) data$GroupSurvival[i] <- data$GroupSurvival[which(data$GroupId==data$GroupId[i])[1]]\n# classify unknown groups\ndata$GroupSurvival[is.na(data$GroupSurvival) & data$Pclass==3] <- 0\ndata$GroupSurvival[is.na(data$GroupSurvival) & data$Pclass!=3] <- 1\n# make predictions\ndata$Predict <- 0\ndata$Predict[data$Sex=='female'] <- 1\ndata$Predict[data$Title=='woman' & data$GroupSurvival==0] <- 0\ndata$Predict[data$Title=='boy' & data$GroupSurvival==1] <- 1\nx = which(data$Sex=='male' & data$Predict==1 & data$PassengerId>891)\ncat(sprintf('We found %d boys predicted to live\\n',length(x)))\nx = which(data$Sex=='female' & data$Predict==0 & data$PassengerId>891)\ncat(sprintf('We found %d females predicted to die\\n',length(x)))","metadata":{"_kg_hide-input":true,"_uuid":"b52547199323effbc4ea8c844da7579d1f8854f0","execution":{"iopub.status.busy":"2023-09-09T14:43:50.538421Z","iopub.execute_input":"2023-09-09T14:43:50.540161Z","iopub.status.idle":"2023-09-09T14:43:50.654837Z"},"trusted":true},"execution_count":7,"outputs":[{"text":"We found 80 woman-child-groups\nWe found 9 nannies/relatives and added them to groups.\nWe found 8 boys predicted to live\nWe found 14 females predicted to die\n","name":"stdout","output_type":"stream"}]},{"cell_type":"code","source":"submit <- data.frame(PassengerId=892:1309,Survived=data$Predict[892:1309])\nsubmit$Survived[maleLive-891] <- 1\nwrite.csv(submit,'WCG_XGBoost1.csv',row.names=F)","metadata":{"_uuid":"610b70aadbd710768900a2133578c79149a4acb2","execution":{"iopub.status.busy":"2023-09-09T14:43:50.657343Z","iopub.execute_input":"2023-09-09T14:43:50.659141Z","iopub.status.idle":"2023-09-09T14:43:50.674190Z"},"trusted":true},"execution_count":8,"outputs":[]},{"cell_type":"markdown","source":"Drum roll..... UGH! Our score stayed the same. It seems that half our predictions for which adult males survive were right and half were wrong. Submitting the WCG plus these additional 4 predictions didn't change the WCG's score even though cross validation suggested that it would :-( However, we did find 1 or 2 adult males that live, hip hip hooray!\n# Explore solo females survival with XGBoost\nLet's apply this XGBoost exploration technique to the solo females. If we can correctly predict the survival of any solo females, we can combine those predictions with the WCG model and have the most accurate Titanic model ever! The training dataset contains 304 females. Of those, 108 are in WCG, 126 are traveling solo, and 80 travel with a brother or husband and have no children. Here we will explore the solo females.","metadata":{"_uuid":"58d691a040537ac7350ced4225aa191d59e03368"}},{"cell_type":"code","source":"# identify WCG females\nWCGtrain = which(data$Passenger<=891 & (data$GroupSurvival==0 | data$GroupSurvival==1))\nWCGtest = which(data$Passenger>891 & (data$GroupSurvival==0 | data$GroupSurvival==1))\n# identify solo females\ndata2 <- data[data$PassengerId<=891 & data$Title=='woman' & data$FamilySize==1,]\ndata3 <- data.frame(y=data2$Survived,x1=data2$FareAdj/10,x2=data2$Age/15,Pclass=data2$Pclass)\n# set zoom\nx1s <- seq(0.5, 1.5, length.out = 100)\nx2s <- seq(1, 3, length.out = 100)\ng <- data.frame(x1 = rep(x1s, each=100), x2 = rep(x2s, time = 100))\n# classify females with XGBoost\nparam <- list(objective   = \"binary:logistic\",\n              eval_metric = \"error\",\n              max_depth   = 5,\n              eta         = 0.1,\n              gammma      = 0.1,\n              colsample_bytree = 1,\n              min_child_weight = 1)\ncat('XGBoosting begun...\\n')\nxgb <- xgboost(params  = param,\n               data    = data.matrix(data3[,c('x1','x2')]),\n              label   = data3$y, \n              nrounds = 500,\n              print_every_n = 100,\n              verbose = 1)\np <- predict(xgb,newdata=data.matrix(g[,c('x1','x2')]))\ng$y <- ifelse(p<=0.25,0,1)\n# plot results\nggplot(data=data3[data3$x1>0.5 & data3$x1<1.5 & data3$x2>1 & data3$x2<3,]) +\n    xlim(0.5,1.5) + ylim(1,3) +\n    geom_tile(data=g,aes(x1,x2,fill=factor(y))) +\n    geom_density_2d(aes(x1,x2,color=factor(y))) +\n    geom_point(size=2,aes(x1,x2,color=factor(y),shape=factor(Pclass))) +\n    scale_color_manual(values=c('#AA0000','#00AA00'),\n        limits=c('0','1'),labels=c('0','1')) +\n    scale_fill_manual(values=c('#FF9999','#99FF99'),\n        limits=c('0','1'),labels=c('0','1')) +\n    labs(x='Fare / (10 x TicketFrequency)',y='Age / 15',shape='Pclass',fill='Classify',\n        title='XGBoost learns the training set\\'s\n        126 solo females. Red is P(die)>=0.75',color='Survived') +\n    geom_vline(xintercept=c(0.8,0.9), linetype='dotted') +\n    annotate('text',x=0.77,y=2.95,label='Fare = $8') +\n    annotate('text',x=0.93,y=2.95,label='Fare = $9') +\n    geom_hline(yintercept=c(1.33,1.67), linetype='dotted') +\n    annotate('text',x=1.35,y=1.61,label='Age = 25') +\n    annotate('text',x=1.35,y=1.28,label='Age = 20')","metadata":{"_kg_hide-input":true,"_uuid":"a13427eb18ee37641580d400b129b310025f9aed","execution":{"iopub.status.busy":"2023-09-09T14:43:50.680913Z","iopub.execute_input":"2023-09-09T14:43:50.682402Z","iopub.status.idle":"2023-09-09T14:43:52.060472Z"},"trusted":true},"execution_count":9,"outputs":[{"text":"XGBoosting begun...\n[1]\ttrain-error:0.134921 \n[101]\ttrain-error:0.055556 \n[201]\ttrain-error:0.023810 \n[301]\ttrain-error:0.023810 \n[401]\ttrain-error:0.023810 \n[500]\ttrain-error:0.023810 \n","name":"stdout","output_type":"stream"},{"output_type":"display_data","data":{},"metadata":{}},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT5RsH8Ocus2k66W6BltJBWS2UvfcSEFCWgggIIqKIIiiioiKiqIjKEhk/\nUJAtshFZogyh7Fn2KJRCd9LM+/2REtIkbZOQtL30+/mLXN5777k3R/PkvefuGI7jCAAAAAD4\njy3vAAAAAADAOZDYAQAAALgJJHYAAAAAbgKJHQAAAICbQGIHAAAA4CaQ2AEAAAC4CSR2AAAA\nAG4CiR0AAACAm3CHxI7TK4ZG+TAME9b6C6sNDn/WkmEYsbzeOYXW7K0Tm5e+MaRnrZrVfWQi\nv9Coxq07D3tjxon7SstOcm9+xlgQiOTRtRv2euGdf27mOX/HnOrUzEYMw3Tecau8A3GVS8ta\nMQzTatml8g4EAACg3LhDYsewsh/3/OAhYNIOvDd2m3niorj/R5dp/xLRmDVbE2RC43Kt4uLo\nLnFJPV/+fsXmi9fSxL5hbO7towd2Lfv+/YYR4S98sNrqEzlYgSzaRBUPzdVzx//49etW0VWn\n7brjwp0Et7M5KZhhmIBaK8tgrQoowVPMMMzP9/LLOxAAALfiDokdEXlFDtkxuTERLRrQ51qB\nzuQd/UedX87W6qv3/PG7bhHGpbqCa33qNF6485JHUMMZ/9t6N1fx4O6Nh3nqB9ePzRjXT6TP\n+nX6gA6f/G25IYlPu1QT6TkF9y7ufb1juF6b9Xm/vkp9+TyfTZOXwjCMT/Wp5bL1clH2u1wJ\nB9mJMHoAAGXDTRI7Imo5bdfzEXJ17rGur240Lry8fNCsUw/FnvW2rhpl2njZkA6br+V413ju\n6JV/Jw/pFlI4k8cEVG8wec7a/5aMYRhm77ROu7NUpW2WCY5tM/uPA2ESgTr3yEJMP4DNGsxY\nsHLlyp++bl4Ga1VAQoaISMAw5R0IAIBbcZ/EjhF4/fTXNxKWufy/Ad+dzSQiTd7xrqPXE9GY\ntVtMT8IqH6x9Zd11VuC1/O9lteUiy67qDP1xdnIgpy+YOPucLZsWSKM6+0qJ6LZKV2pjt5d/\n+8z2TZtvVLKhcGCvw7o+O3DgwD7dq9u1IcfWqoC6+XswjKCzn7S8AwEAcCvuk9gRkU/MK1sm\nJHGcbkqnUXk6btGAPleV2uq95s3uGmHa7MTHH+k5LqLzT71CZcV19fJvazZs2DC9dZAt29Vr\n0vdlqxiG7VXFw2Sx7q//TR/Qs2N8tUBZlYim7Xu8/uGC2wWWX/w2NctO3f/eSz3qxUXKxR6h\nkXHt+7y29dQDw1srawWIvRoQUc7NzxiGqRK3xJaYDa7tWzFy8LMN4qtJPXxr1kke8/H8VIvr\nS/Sa9FWzJ7dq