below and add hyperparamters that you wish to search. In this notebook, I'm not doing the grid search because it takes a while. I did it offline) Now let's perform cross validation to see to see if XGBoost is more accurate than the gender model which has CV = 78.6%.","metadata":{"_uuid":"7eb6934e513bdb26148dc579531fc8f76bee9f1c"}},{"cell_type":"code","source":"#accuracy = matrix(nrow=4,ncol=4)\n#rownames(accuracy) <- c('d=3','d=4','d=5','d=6')\n#colnames(accuracy) <- c('0.08','0.10','0.25','0.50')\n#for (j in 1:4)\n#for (k in 1:4){\ntrials=100; sum=0\nfor (i in 1:trials){\n    s = sample(1:891,800)\n    s2 = (1:891)[-s]\n    dataB <- data[data$PassengerId %in% s & data$Title=='woman' & data$FamilySize==1,]\n    dataC <- data[data$PassengerId %in% s2 & data$Title=='woman'& data$FamilySize==1,]\n    data$Predict <- 0\n    data$Predict[data$Sex=='female'] <- 1\n    dataTrain <- data.frame(y=dataB$Survived,x1=dataB$FareAdj/10,x2=dataB$Age/15)\n    dataTest <- data.frame(y=dataC$Survived,x1=dataC$FareAdj/10\n        ,x2=dataC$Age/15,PassengerId=dataC$PassengerId)\n    param <- list(objective   = \"binary:logistic\",\n              eval_metric = \"error\",\n              max_depth   = 5,\n              eta         = 0.1,\n              gammma      = 0.1,\n              colsample_bytree = 1,\n              min_child_weight = 1)\n    xgb <- xgboost(params  = param,\n              data    = data.matrix(dataTrain[,c('x1','x2')]),\n              label   = dataTrain$y, \n              nrounds = 500,\n              silent = 1,\n              print_every_n = 100,\n              verbose = 0)\n    p <- predict(xgb,newdata=data.matrix(dataTest[,c('x1','x2')]))\n    dataTest$p <- ifelse(p<=0.08,0,1)\n    data$Predict[dataTest$PassengerId] <- dataTest$p \n    sm = sum(abs(data$Predict[s2] - data$Survived[s2]))\n    cv = 1 - sm/length(s2)\n    #if (i %% 25==0) \n    #cat(sprintf('Trial %d has CV = %f\\n',i,cv))\n    sum = sum + cv\n}\ncat(sprintf('Average CV of %d trials = %f\\n',trials,sum/trials))\n#accuracy[j,k] <- sum/trials\n#}\n#accuracy","metadata":{"_kg_hide-input":true,"_uuid":"4fab6ee6b21cf70b2b53ea6f0d3b756ba6739022","execution":{"iopub.status.busy":"2023-09-09T14:43:52.062595Z","iopub.execute_input":"2023-09-09T14:43:52.064026Z","iopub.status.idle":"2023-09-09T14:44:08.584535Z"},"trusted":true},"execution_count":10,"outputs":[{"text":"Average CV of 100 trials = 0.791429\n","name":"stdout","output_type":"stream"}]},{"cell_type":"markdown","source":"Our CV accuracy is 79.0%. (Results shown above may vary due to the random nature of k-fold CV but I confirmed 79.0% with 10,000 trials offline). The gender model has a CV accuracy of 78.6%, therefore we have achieved a slight improvement. Hopefully, we can achieve a slight improvement to our public score too. Let's see.\n## Submission to Kaggle","metadata":{"_uuid":"ccf503c30530b6fbc6bf74b0698e9ee91918205a"}},{"cell_type":"code","source":"dataB <- data[data$PassengerId %in% 1:891 & data$Title=='woman' & data$FamilySize==1,]\ndataC <- data[data$PassengerId %in% 892:1309 & data$Title=='woman' & data$FamilySize==1 \n    & !data$PassengerId %in% WCGtest,]\ndata$Predict <- 0\ndata$Predict[data$Sex=='female'] <- 1\ndataTrain <- data.frame(y=dataB$Survived,x1=dataB$FareAdj/10,x2=dataB$Age/15)\ndataTest <- data.frame(y=dataC$Survived,x1=dataC$FareAdj/10\n    ,x2=dataC$Age/15,PassengerId=dataC$PassengerId,Pclass=dataC$Pclass)\nparam <- list(objective   = \"binary:logistic\",\n              eval_metric = \"error\",\n              max_depth   = 5,\n              eta         = 0.1,\n              gammma      = 0.1,\n              colsample_bytree = 1,\n              min_child_weight = 1)\nxgb <- xgboost(params  = param,\n              data    = data.matrix(dataTrain[,c('x1','x2')]),\n              label   = dataTrain$y, \n              nrounds = 500,\n              silent = 1,\n              print_every_n = 100,\n              verbose = 0)\np <- predict(xgb,newdata=data.matrix(dataTest[,c('x1','x2')]))\ndataTest$p <- ifelse(p<=0.08,0,1)\ndata$Predict[dataTest$PassengerId] <- dataTest$p \nfemalePerish = which(data$Title=='woman' & data$Predict==0)\ncat(sprintf('The following %d females are predicted to die\\n',length(femalePerish)))\ndata[femalePerish,c('PassengerId','Pclass','Name','Age','SibSp','Parch','FareAdj')]","metadata":{"_kg_hide-input":true,"_uuid":"111b732164fb2b525ed1b2788ab69438815ccce0","execution":{"iopub.status.busy":"2023-09-09T14:44:08.587488Z","iopub.execute_input":"2023-09-09T14:44:08.589698Z","iopub.status.idle":"2023-09-09T14:44:08.799952Z"},"trusted":true},"execution_count":11,"outputs":[{"text":"The following 10 females are predicted to die\n","name":"stdout","output_type":"stream"},{"output_type":"display_data","data":{"text/plain":"     PassengerId Pclass Name                                    Age      SibSp\n928   928        3      Roth, Miss. Sarah A                     24.92668 0    \n990   990        3      Braf, Miss. Elin Ester Maria            20.00000 0    \n1030 1030        3      Drapkin, Miss. Jennie                   23.00000 0    \n1061 1061        3      Hellstrom, Miss. Hilda Maria            22.00000 0    \n1091 1091        3      Rasmussen, Mrs. (Lena Jacobsen Solvang) 24.92668 0    \n1098 1098        3      McGowan, Miss. Katherine                35.00000 0    \n1160 1160        3      Howard, Miss. May Elizabeth             24.92668 0    \n1172 1172        3      Oreskovic, Miss. Jelka                  23.00000 0    \n1205 1205        3      Carr, Miss. Jeannie                     37.00000 0    \n1304 1304        3      Henriksson, Miss. Jenny Lovisa          28.00000 0    \n     Parch FareAdj\n928  0     8.0500 \n990  0     7.8542 \n1030 0     8.0500 \n1061 0     8.9625 \n1091 0     8.1125 \n1098 0     7.7500 \n1160 0     8.0500 \n1172 0     8.6625 \n1205 0     7.7500 \n1304 0     7.7750 ","text/latex":"\\begin{tabular}{r|lllllll}\n  & PassengerId & Pclass & Name & Age & SibSp & Parch & FareAdj\\\\\n\\hline\n\t928 &  9